import React from "react"

import "./App.css"

const App = () => {
  const instruments = [
    { id: 1, src: "../images/instruments/violin.jpg", title: "violin" },
    { id: 2, src: "../images/instruments/clarinet.jpg", title: "clarinet" },
    { id: 3, src: "../images/instruments/cello.jpg", title: "cello" },
    { id: 4, src: "../images/instruments/bassoon.jpg", title: "bassoon" },
    { id: 5, src: "../images/instruments/bass.jpg", title: "bass" },
    { id: 6, src: "../images/instruments/flute.jpg", title: "flute" },
    { id: 7, src: "../images/instruments/frenchhorn.jpg", title: "frenchhorn" },
    { id: 8, src: "../images/instruments/harp.jpg", title: "harp" },
    { id: 9, src: "../images/instruments/oboe.jpg", title: "oboe" },
    {
      id: 10,
      src: "../images/instruments/percussion.jpg",
      title: "percussion"
    },
    { id: 11, src: "../images/instruments/trombone.jpg", title: "trombone" },
    { id: 12, src: "../images/instruments/trumpet.jpg", title: "trumpet" },
    { id: 13, src: "../images/instruments/tuba.jpg", title: "tuba" },
    { id: 14, src: "../images/instruments/viola.jpg", title: "viola" }
  ]
  return (
    <>
      {instruments.map(({ id, src, title }) => (
        <img key={id} src={src} title={title} alt={title} />
      ))}
    </>
  )
}

export default App
